import { createSlice } from "@reduxjs/toolkit";

const initialCityCodesState = { allCities: [] };

const CityCodesSlice = createSlice({
  name: "CityCodes",
  initialState: initialCityCodesState,
  reducers: {
    fetchedCityCodes(state, action) {
      state.allCities = [...action.allCities];
    },
  },
});

export default CityCodesSlice.reducer;

export const CityCodesAction = CityCodesSlice.actions;
